#Complementing a Strand of DNA

dna = ""
revDNA = dna[::-1]

A = 1
C = 2
G = 3
T = 4

revCompCode = revDNA.replace('A',str(T)).replace('C',str(G)).replace('G',str(C)).replace('T',str(A))
revComp = revCompCode.replace(str(A),'A').replace(str(C),'C').replace(str(G),'G').replace(str(T),'T')

print(revComp)
